// SPDX-License-Identifier: UNLICENSED
pragma solidity ^0.8.0;

contract CarbonCreditExchange {
    struct Credit {
        uint id;
        string project;
        uint amount;
        address owner;
        uint expirationDate;
        bool isRevoked;
    }

    struct Transaction {
        uint creditId;
        string action;
        address from;
        address to;
        uint timestamp;
    }

    mapping(uint => Credit) public credits;
    uint public nextCreditId;

    Transaction[] public transactions;

    event CreditIssued(uint id, string project, uint amount, address indexed owner);
    event CreditTransferred(uint id, address indexed from, address indexed to);
    event CreditApproved(uint id);
    event CreditRevoked(uint id);

    function issueCredit(string memory _project, uint _amount, uint _expirationPeriod) public {
        require(_amount > 0, "Amount must be greater than zero");

        credits[nextCreditId] = Credit({
            id: nextCreditId,
            project: _project,
            amount: _amount,
            owner: msg.sender,
            expirationDate: block.timestamp + _expirationPeriod,
            isRevoked: false
        });

        transactions.push(Transaction({
            creditId: nextCreditId,
            action: "Issued",
            from: address(0),
            to: msg.sender,
            timestamp: block.timestamp
        }));

        emit CreditIssued(nextCreditId, _project, _amount, msg.sender);
        nextCreditId++;
    }

    function transferCredit(uint _id, address _to) public {
        require(_id < nextCreditId, "Credit ID does not exist");
        require(_to != address(0), "Invalid recipient address");

        Credit storage credit = credits[_id];
        require(credit.owner == msg.sender, "Only the owner can transfer the credit");
        require(!credit.isRevoked, "Cannot transfer a revoked credit");

        credit.owner = _to;

        transactions.push(Transaction({
            creditId: _id,
            action: "Transferred",
            from: msg.sender,
            to: _to,
            timestamp: block.timestamp
        }));

        emit CreditTransferred(_id, msg.sender, _to);
    }

    function getTransactionHistoryCount() public view returns (uint) {
        return transactions.length;
    }

    function getTransactionDetails(uint _index) public view returns (uint, string memory, address, address, uint) {
        require(_index < transactions.length, "Transaction index out of bounds");
        Transaction memory transaction = transactions[_index];
        return (transaction.creditId, transaction.action, transaction.from, transaction.to, transaction.timestamp);
    }
}
